css:
@-moz-document url-prefix("https://discordapp.com/channels/226042379126177793") {
/* Generated by Font Squirrel (http://www.fontsquirrel.com) on September 1, 2015 */


@font-face {
font-family:"burrito-boy";
src:url(data:font/ttf;base64,) format('woff2'),
         url(data:application/font-woff;charset=utf-8;base64,) format('truetype');
}

/* burrito boy everything */
* {
    font-family: "burrito-boy" !important;
}

/* floaty text */
@keyframes floaty {
    0% {transform: translateY(0em);}
    50% {transform: translateY(0.2em);}
    100% {transform: translateY(0em);}
}

div.markup {
    transition: transform 0.5s ease-out;
}
div.message-group:hover div.markup {
    animation: 1s infinite floaty;
}
div.message-group {
    transition: transform 0.7s ease-out;
}
div.message-group:hover {
    animation: 1.4s infinite reverse floaty;
}


/* rainbow links */
div.markup a {
    background: -webkit-linear-gradient(left, red, orange , yellow, green, cyan, blue, violet);
    background: -o-linear-gradient(right, red, orange, yellow, green, cyan, blue, violet);
    background: -moz-linear-gradient(right, red, orange, yellow, green, cyan, blue, violet);
    background: linear-gradient(to right, red, orange , yellow, green, cyan, blue, violet);
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
}

/* temmie vibrates intensely */
@keyframes shake {
	0% { transform: translate(2px, 1px) rotate(0deg); }
	10% { transform: translate(-1px, -2px) rotate(-1deg); }
	20% { transform: translate(-3px, 0px) rotate(1deg); }
	30% { transform: translate(0px, 2px) rotate(0deg); }
	40% { transform: translate(1px, -1px) rotate(1deg); }
	50% { transform: translate(-1px, 2px) rotate(-1deg); }
	60% { transform: translate(-3px, 1px) rotate(0deg); }
	70% { transform: translate(2px, 1px) rotate(-1deg); }
	80% { transform: translate(-1px, -1px) rotate(1deg); }
	90% { transform: translate(2px, 2px) rotate(0deg); }
	100% {transform: translate(1px, -2px) rotate(-1deg); }
}
div.markup a {
    transform-origin: 50% 50%;
    display: inline-block;
}
div.markup a:hover {
    animation: 0.5s infinite shake;
}
}
